import React from "react";

function Sidebar() {
	return (
		<div className="sidebar">
			<div className="sidebar__logo">
				<img src={!theme ? Logo : LogoDark} alt="logo" className="logo" />
			</div>
		</div>
	);
}

export default Sidebar;
